import React from "react";
import Header from "../components/Header";
import Footer from "../components/Footer";
import { fire } from "../config/fire";

function Home() {
  function getPosts() {
    fire
      .firestore()
      .collection("posts")
      .get()
      .then(querySnapshot => {
        querySnapshot.forEach(doc => console.log(doc.data()));
      });
  }
  return (
    <div>
      <Header />
      {getPosts()}
      <Footer />
    </div>
  );
}

export default Home;
